import { Button } from '@material-ui/core'
import React from 'react'
import { useNavigate } from 'react-router'
import "../styles/Banner.css"

function Banner() {

    let history = useNavigate()

    const priceRedirect = () => {
        history.push("/price")
    }

    const placeHolder = () => {
        history.push("/placeholder")
    }

    return (
        <div className="banner position-absolute top-50 start-50 translate-middle text-bg-dark p-3" >
            <div className="banner text-center">
                <div className="banner__title_head fs-6" >
                    AutoWatch
                </div>
                <div className="banner__title_tail">
                    <div className="typing">A Machine Learning based Web Application for market price recommendation of cars</div>
                    <div className="banner__buttons">
                        <Button onClick={priceRedirect} className="banner__button priceButton">Price Recommender</Button>
                        <Button onClick={placeHolder} className="banner__button fertilizerButton">Place Holder</Button>
                    </div>

                </div>
            </div>
        </div>
    )
}

export default Banner
